  Statistics of Autumn and Spring Annual Snow Cover for the Northern Hemisphere, 1972
  to 2000\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-09-26T22:46:40.600187\",\n\t\"name\":
  \"timing-and-statistics-of-autumn-and-spring-annual-snow-cover-for-the-northern-hemisphere-1-2000\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"nThe National Snow and Ice Data Center
  hosts a time-series data set comprising annual snow cover data  for the Northern
  Hemisphere (covering land primarily over 45 degrees North) from 1972 to 2000.  Data
  are presented for land areas that exhibited snow cover in each of the 29 years.
  Variables are the  week of snow disappearance, the week of snow cover onset, and
  the duration of the snow-free period.  These variables were derived from operational
  NOAA weekly snow cover charts that have been quality  controlled by the Rutgers
  University Global Snow Lab. For each year of the 29-year period, there are  three
  binary files with data in an 89 x 89 cell grid. The week of the first detected snow
  cover in the fall  is included in the WFS file, the week of the last observed snow
  cover in the spring is given in the WLS  file, and the duration of snow-free period
  in weeks is given in the DSF file. Data are also provided in ASCII format summary
  files. In addition, summary statistics for each parameter are provided. These are
  \ grids of the mean and the standard deviation for the three parameters. Gridded
  latitude and longitude  files are also included with this data set.n\",\n\t\"license_title\":
